import React from 'react';
import CardList from './CardList';
import {robo} from './robodata';
import SearchBox from './SearchBox';

const App = ()=>
{
	return(
		<div>
		<h1 className='tc'>Robo Friends</h1>
		<SearchBox />
		<CardList robo ={ robo }/>
		</div>
		);
}

export default App;
